import React from 'react';
import Item from './Item';

export default function ItemList(props) {
  const { products, onAdd, onRemove, onPurchase } = props;
  return (
    <div>
      <div>
        {products.length === 0 && <div>Cart is empty</div>}
        {products.map((product) => (
            <Item key={product.id} product={product} onAdd={onAdd} onRemove={onRemove} handleShow={handleShow} onPurchase={onPurchase} handleClose={handleClose} deleteItem={deleteItem} show={show}></Item>
        ))}
      </div>
    </div>
  );
}
